        </div>
        <div class="tab">
            <table cellpadding="0" cellspacing="5" border="0" style="width: 100%;">
                <tr>
                    <td colspan="2">
                        <fieldset style="padding: 0; margin-top: 0">
                            <legend style="color:black; text-align:center">Log Events</legend>
                            <div style="width: 350px; margin-top: 10px; margin-bottom: 10px; margin-left: 10px">
                                        <span style="float: left; width: 175px">
                                            <input id="EventSetCheckBox.All" type="checkbox" onclick="onEventSetCheckBoxClick(this)">
                                            <label for="EventSetCheckBox.All">All</label>
                                        </span>
                                <br style="clear: both"/>
                                <hr style="border: none; border-top: 1px dotted #ACA899;"/>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Login" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Login">Login</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Logout" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Logout">Logout</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Failure" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Failure">Failure</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Browse" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Browse">Browse</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Create" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Create">Create</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Delete" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Delete">Delete</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Rename" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Rename">Rename</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Copy" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Copy">Copy</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Move" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Move">Move</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Compress" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Compress">Compress</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Extract" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Extract">Extract</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Upload" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Upload">Upload</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Download" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Download">Download</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.PublicLink" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.PublicLink">Public Link</label>
                                        </span>
                                <span style="float: left; width: 175px">
                                            <input id="EventCheckBox.Preview" type="checkbox" onclick="onEventCheckBoxClick(this)">
                                            <label for="EventCheckBox.Preview">Preview</label>
                                        </span>
                                <br style="clear: both"/>
                            </div>
                        </fieldset>
                        <fieldset style="padding: 0; margin-top: 10px">
                            <legend style="color:black; text-align:center">Log size</legend>
                            <div style="margin-left: 10px; margin-top: 10px; margin-bottom: 10px">
                                Maximum log size:&nbsp;&nbsp;&nbsp;<input id="TextBoxLogSize" type="text" style="width: 40px; text-align: right" maxLength="10" value="1000"/>
                                events
                                <br/>
                                <br/>
                                When maximum log size is reached:
                                <br/>
                                <br/>
                                Delete events older than <input id="TextBoxLogClearDays" type="text" style="width: 30px; text-align: right" maxLength="3" value="7"/>days

                            </div>
                        </fieldset>
                    </td>
                </tr>
                <tr>
                    <td colspan="2" style="text-align: right">
                        <input type="submit" name="ButtonClearLog" value="Clear Log" onclick="return onClearLog();" id="ButtonClearLog" style="width: 100px"/>
                    </td>
                </tr>
            </table>
        </div>
        <div class="tab">
            <table cellpadding="0" cellspacing="10" border="0" style="width: 100%;">
                <tr>
                    <td colspan="2">
                        <input id="CheckBoxSendEmailNotifications" type="checkbox" name="CheckBoxSendEmailNotifications"/>
                        <label for="CheckBoxSendEmailNotifications">Send email notifications</label>
                    </td>
                </tr>
                <tr>
                    <td colspan="2">
                        <hr/>
                    </td>
                </tr>
                <tr>
                    <td>From email address:</td>
                    <td align="right">
                        <input name="TextboxFromEmailAddress" type="text" id="TextboxFromEmailAddress" style="width:180px"/>
                    </td>
                </tr>
                <tr>
                    <td valign="top">Email delivery method:</td>
                    <td align="right">
                        <select name="DropDownEmailDeliveryMethod" id="DropDownEmailDeliveryMethod" onchange="onEmailDeliveryChange(this)" style="width:185px">
                            <option selected="selected" value="SmtpServer">SMTP server</option>
                            <option value="SpecifiedPickupDirectory">Specified pickup directory</option>
                            <option value="PickupDirectoryFromIis">Pickup directory from IIS</option>
                        </select>
                    </td>
                </tr>
            </table>
            <hr style="border: none; border-top: 1px dotted #ACA899; margin-left: 10px; margin-right: 10px;"/>
            <table id="SmtpServerSettingsTable" cellpadding="0" cellspacing="10" border="0" style="width: 100%; display:none">
                <tr>
                    <td>SMTP host:</td>
                    <td align="right">
                        <input name="TextboxSmtpServer" type="text" value="localhost" id="TextboxSmtpServer" style="width:180px"/>
                    </td>
                </tr>
                <tr>
                    <td>SMTP port:</td>
                    <td align="right">
                        <input name="TextboxSmtpServerPort" type="text" value="25" id="TextboxSmtpServerPort" style="width:50px; text-align: right"/>
                    </td>
                </tr>
                <tr>
                    <td valign="top">SMTP authentication:</td>
                    <td align="right">
                        <select name="DropDownSmtpAuthentication" id="DropDownSmtpAuthentication" onchange="onSmtpAuthenticationChange(this)" style="width:185px">
                            <option selected="selected" value="Anonymous">Anonymous</option>
                            <option value="Windows">Use Windows credentials</option>
                            <option value="Custom">Use below credentials</option>
                        </select>
                    </td>
                </tr>
                <tr>
                    <td colspan="2">
                        <table cellpadding="4" cellspacing="0" border="0" style="margin-left: 20px; margin-top: 0px;">
                            <tr>
                                <td>
                                    <label id="LabelSmtpUserName" for="TextboxSmtpUserName">User name:</label>
                                </td>
                                <td align="right">
                                    <input name="TextboxSmtpUserName" type="text" id="TextboxSmtpUserName" style="width:120px"/>
                                </td>
                            </tr>
                            <tr>
                                <td>
                                    <label id="LabelSmtpPassword" for="TextboxSmtpPassword">Password:</label>
                                </td>
                                <td align="right">
                                    <input name="TextboxSmtpPassword" type="text" id="TextboxSmtpPassword" style="width:120px"/>
                                </td>
                            </tr>
                        </table>
                    </td>
                </tr>
                <tr>
                    <td colspan="2">
                        <input id="CheckBoxSmtpUseSsl" type="checkbox" name="CheckBoxSmtpUseSsl"/>
                        <label for="CheckBoxSmtpUseSsl">Use SSL</label>
                    </td>
                </tr>
            </table>
            <table id="SpecifiedPickupSettingsTable" cellpadding="0" cellspacing="10" border="0" style="width: 100%; display:none">
                <tr>
                    <td align="left">Pickup directory location:</td>
                    <td align="right">
                        <input name="TextboxPickupDirectoryLocation" type="text" value="~/App_Data/Email" id="TextboxPickupDirectoryLocation" style="width:180px"/>
                    </td>
                </tr>
            </table>
            <table cellpadding="0" cellspacing="10" border="0" style="width: 100%;">
                <tr>
                    <td colspan="2" style="text-align: right">
                        <input type="submit" name="ButtonTestSmtp" value="Test Email" onclick="onSubmit();" id="ButtonTestSmtp" style="width: 100px"/>
                    </td>
                </tr>
            </table>
        </div>
    </div>
    <div class="gt-formBottom">
        <input type="submit" name="ButtonOK" value="OK" onclick="onSubmit();" id="ButtonOK" style="width: 80px"/>
        &nbsp;<input type="submit" name="ButtonCancel" value="Cancel" onclick="elementDialog.close(); return false;" id="ButtonCancel" style="width: 80px"/>
    </div>
</form>
</body>
</html>
